import styled from 'styled-components';

const navbar = styled.div`
  font-family: sans-serif;
  display: flex;
  align-items: left;
  justify-content: left;
  flex-direction: column;
`;

const links = styled.div`
  font-family: sans-serif;
  display: flex;
  align-items: right;
  justify-content: right;
  flex-direction: column;
`;
export {
  navbar,
  links,
};
